import React, { useState } from "react";
import { useNavigate } from 'react-router-dom';
import './Header_nav.css';

function Header_nav() {
    const navigate = useNavigate();
    const [isLoggedIn, setIsLoggedIn] = useState(true); // 임시로 로그인 상태 true로 설정

    const handleLogout = () => {
        setIsLoggedIn(false);
        navigate('/'); // 메인 페이지로 이동
    };

    const handleMyPage = () => {
        navigate('/mypage');
    };

    return (
        <header className="Header_nav">
            <h1 className="logo">FeelsLike</h1>
            <nav>
                <ul className="nav-links">
                    <li>About Us</li>
                    <li>Contact Us</li>
                    {isLoggedIn && (
                        <>
                            <li onClick={handleLogout}>Logout</li>
                            <li onClick={handleMyPage}>My Page</li>
                        </>
                    )}
                </ul>
            </nav>
        </header>
    );
}

export default Header_nav;
